import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App () {
    console.log(notes);
    return(
        <div>
        <Header/>
        <Note
        key={notes[1].title}
        title="test"
        content="content"
        />
        <Footer/>
        </div>
    );
    
}

export default App;




